import React from 'react';
import '../App.css'
import {Toolbar,Drawer,Box,CssBaseline} from '@mui/material';



const drawerWidth = 240;

export const Sidebar=()=>{
  return (
    <div>
    <Box sx={{
          display: 'flex',
          flexDirection: 'column',
          height: '100%'
        }}>
      <CssBaseline />

      <Drawer

        sx={{

          width: drawerWidth,
          flexShrink: 0,
          '& .MuiDrawer-paper': {
            width: drawerWidth,
            boxSizing: 'border-box',
            backgroundColor:"#234872",

          },
        }}
        variant="permanent"
        anchor="left"
      >





      </Drawer>

    </Box>
    </div>
  );
}
